export const KING = {
  title: "King One Bed",
  body: ["A", "B", "C", "D"],
  image: king,
};

export const QUEEN = {
  title: "Queen One Bed",
  body: ["A", "B", "C", "D"],
  image: queen,
};

export const FULL = {
  title: "Full One Bed",
  body: ["A", "B", "C", "D"],
  image: full,
};

export const DOUBLE = {
  title: "Double Two Bed",
  body: ["A", "B", "C", "D"],
  image: double,
};
